const response = pm.response.json();


pm.test("Status code is 200", function () {
    pm.response.to.have.status(200);
});
pm.test("Response return with correct information", function () {
    pm.expect( response.response.length ).to.eql( 4 )
});
pm.test('All projects should have the same parent project id', function() {
    let sameProjectID = true;
    response.response.map( obj => {
        if (obj.parent_project_id !== 1) sameProjectID = false;
    })
    pm.expect(sameProjectID).to.eql(true);
})
